	private static int nearestMaxValue(int[] arr, int target) {
		int count = 0;
		int start = 0;
		int end = arr.length;
		while(start <= end) {
			int mid = start + (end - start)/2;
			if(arr[mid] > target ) {
				end = mid -1;
			}else {
				start = mid + 1;
			}
			count++;
		}
		System.out.println("it Took "+count+" Bineary counts");
		return arr[start];
	}

